create table foods_food
(
    id              int auto_increment
        primary key,
    name_en         varchar(255) null,
    name_fr         varchar(253) not null,
    activated       tinyint(1)   null,
    foodGroup_id    int          null,
    nb_of_selection int          not null,
    constraint foods_food_foodGroup_id_6cd96c1d_fk_foods_foodgroup_id
        foreign key (foodGroup_id) references foods_foodgroup (id)
);

create index foods_food_name_fr_ee1c37_idx
    on foods_food (name_fr);

